import React, { Component } from 'react'
import AddItems from './component/AddItems/AddItems'
import TodoItems from './component/TodoItems/TodoItems'


class App extends Component{

    constructor(){
        super();
        this.state = [
        { Id: 1,   name: "John",    age: '22'  },
        { Id: 2,   name: "Noah",    age: '40'  },
        { Id: 3,   name: "Adam",    age: '55'  },
    ]
    }

    mapping(arr){
        return(
            arr.map(
                res => <TodoItems
                id   = { res.Id   }
                name = { res.name }
                age  = { res.age  }

                />
            )
        )
    }

    render(){
        return(
            <div>
                {this.mapping}
            </div>
        )
    }
}

export default App
